export interface TokenListToken {
  name: string;
  address: string;
  symbol: string;
  decimals: number;
  logoURI?: string;
  chainId: number;
}

export interface TokenList {
  name: string;
  logoURI: string;
  keywords: string[];
  timestamp: string;
  version: {
    major: number;
    minor: number;
    patch: number;
  };
  tokens: TokenListToken[];
}